  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Bear River Migratory Bird Refuge for the next
  15 years. This plan outlines the Refuge vision and purpose and describes how Bear
  River Migratory Bird Refuge will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the Refuge, Refuge goals and objectives,
  management policies, and implementation and monitoring strategies. Key planning
  issues include: habitat management, public use, and cultural resources.\",\n\t\"license_title\":
